import React from 'react';
import ChangeProfile from './ChangeProfile';

const Profile = (props) => {
  return (
    <div>
      <h1>profile: username is {props.username}</h1>
      <ChangeProfile setUserName={props.setUserName}/>
    </div>
  )
}

export default Profile
